import { ADD_MOVEMENT } from '../actions/constants.js';

const initialState = {};

const addMovementReducer = (state = initialState, payload) => {
    const newMovement = "newMovement";
    switch (action.type) {
        case ADD_MOVEMENT: 
            return { ...state, ...payload };
        default:
            return state;
    }
};

export default addMovementReducer;
